import React, { useState } from 'react';


const Volunteers=()=>{

const [vol,setVol]= useState([]);
React.useEffect(() => {
    fetch("/getvols")
      .then((res) => res.json())
      .then((data) => {
          setVol(data.volunteers)
      });
  }, []);
  return(
    <div>
        {
            vol.map((volunteer)=>{
              return( <div><h1>{volunteer.full_name}</h1>
                <button className="btn btn-primary"><a href={`mailto:${volunteer.email}`}>Connect over Mail!</a></button>
                </div>
              )
            })
        }
    </div>
  );
}
export default Volunteers;
